import React, { Component } from "react";

class Loginpage3 extends Component {
    constructor(props){
        super();
        this.state ={
            name:null,
            address:null,
            contact:null
        }
    }
  render() {
    return (
      <>
        <div>
          <h1>Login Data</h1>
          <p>{this.props.name}</p>
        </div>
      </>
    );
  }
}
export default Loginpage3;
